import React from 'react'
import './tasks.scss'
import MyTitle from '../../MyTitle/MyTitle'

const Tasks = ({ darkMode, listItems, setListItems }) => {
  return (
    <div className='mainContent__tasks'>
      {listItems.map(
        category => (
          (<div className='mainContent__categoryTitle'>{category}</div>),
          (<MyTitle>Active tasks</MyTitle>)
        ),
      )}
    </div>
  )
}

export default Tasks
